import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Stock from './Stock'; // Importa tu componente Stock
import ProductDetail from './ProductDetail'; // Importa tu componente ProductDetail

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Stock} />
        <Route path="/product/:id" component={ProductDetail} />
      </Switch>
    </BrowserRouter>
  );
}
